const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XI", "p": 243}, {"t": "text", "c": ["Il avait un grand air d\u2019autorit\xE9."], "p": 243}, {"t": "text", "c": ["\xAB Les grandes personnes sont bien \xE9tranges \xBB, se dit le petit prince, en luim\xEAme, durant son voyage."], "p": 244}, {"t": "text", "c": ["La seconde plan\xE8te \xE9tait habit\xE9e par un vaniteux :"], "p": 246}, {"t": "text", "c": ["- Ah ! Ah ! Voil\xE0 la visite d\u2019un admirateur ! s\u2019\xE9cria de loin le vaniteux d\xE8s qu\u2019il aper\xE7ut le petit prince."], "p": 247}, {"t": "text", "c": ["Car, pour les vaniteux, les autres hommes sont des admirateurs. - Bonjour, dit le petit prince. Vous avez un dr\xF4le de chapeau."], "p": 249}, {"t": "text", "c": ["- C\u2019est pour saluer, lui r\xE9pondit le vaniteux.", "C\u2019est pour saluer quand on m\u2019acclame.", "Malheureusement il ne passe jamais personne par ici."], "p": 250}, {"t": "text", "c": ["- Ah oui ? dit le petit prince qui ne comprit pas."], "p": 251}, {"t": "text", "c": ["- Frappe tes mains l\u2019une contre l\u2019autre, conseilla donc le vaniteux."], "p": 252}, {"t": "text", "c": ["Le petit prince frappa ses mains l\u2019une contre l\u2019autre.", "Le vaniteux salua modestement en soulevant son chapeau."], "p": 253}, {"t": "text", "c": ["\xAB \xC7a c\u2019est plus amusant que la visite au roi \xBB, se dit en lui-m\xEAme le petit prince.", "Et il recommen\xE7a de frapper ses mains l\u2019une contre l\u2019autre.", "Le vaniteux recommen\xE7a de saluer en soulevant son chapeau."], "p": 254}, {"t": "text", "c": ["Apr\xE8s cinq minutes d\u2019exercice le petit prince se fatigua de la monotonie du jeu : - Et, pour que le chapeau tombe, demanda-t-il, que faut-il faire ?"], "p": 256}, {"t": "text", "c": ["Mais le vaniteux ne l\u2019entendit pas.", "Les vaniteux n\u2019entendent jamais que les louanges."], "p": 257}, {"t": "text", "c": ["- Est-ce que tu m\u2019admires vraiment beaucoup ? demanda-t-il au petit prince."], "p": 258}, {"t": "text", "c": ["- Qu\u2019est-ce que signifie admirer ?"], "p": 259}, {"t": "text", "c": ["- Admirer signifie reconna\xEEtre que je suis l\u2019homme le plus beau, le mieux habill\xE9, le plus riche et le plus intelligent de la plan\xE8te."], "p": 260}, {"t": "text", "c": ["- Mais tu es seul sur ta plan\xE8te !"], "p": 261}, {"t": "text", "c": ["- Fais-moi ce plaisir. Admire-moi quand m\xEAme !"], "p": 262}, {"t": "text", "c": ["- Je t\u2019admire, dit le petit prince, en haussant un peu les \xE9paules, mais en quoi cela peut-il bien t\u2019int\xE9resser ?"], "p": 263}]}';export{e as default};
